import { AppBar, Tab, Tabs, Toolbar, Typography,useMediaQuery,useTheme } from '@mui/material'
import React, { useState } from 'react'
import DrawerComp from './DrawerComp'
import HomeIcon from '@mui/icons-material/Home';
const Navbar = () => {
  const [value, setValue]=useState();

  const theme = useTheme();
  console.log(theme)

  const isMatch = useMediaQuery(theme.breakpoints.down('md'));
  console.log(isMatch);
  return (


    <React.Fragment>
      <AppBar sx={{background:'	#808080'}}>
        <Toolbar>
          <HomeIcon/>


       
        
         
      <Tabs  textColor="inherit" sx={{marginLeft: 'auto'}} value={0} indicatorColor="secondary" >
      <Tab label="Our Service"/>
      <Tab label="Why Us"/>
      <Tab label="Testimonial"/>
      <Tab label="FAQ"/>
      </Tabs>
      </Toolbar>
      <DrawerComp/>
      </AppBar>
    </React.Fragment>
  )
}

export default Navbar
